import React, { Component } from 'react';
import Nav from '../Nav/Nav';
import ResultDisplay from '../ResultDisplay/ResultDisplay';
import Footer from '../Footer/Footer';
import ResultsTitle from '../ResultsTitle/ResultsTitle';
import {Group, Person} from '../../groupClass.js';


export default class ResultsPage extends Component {
  constructor(props) {
    super(props);
    //let TempGroupObject = new Group();
    this.state = {
       TempGroupObject: props.location.state
    }

    this.saveProject = this.saveProject.bind(this);
    //console.log(this.state.TempGroupObject.aGroupObject.projectName);
    console.log(props.location.state);
    console.log(this.state.TempGroupObject.aJson.projectName);



  }

  saveProject() {
    console.log("SAVE BUTTON CLICKED...");
  }

  render(){
    return (
        <div className="page-wrapper">
          <header>
            <Nav />
            <ResultsTitle title={this.state.TempGroupObject.aJson.projectName}/>
          </header>
          <main id="entry-container">
            <ResultDisplay />
          </main>
            <Footer
              value="Save"
              text="Save"
              onClick={this.saveProject}/>
        </div>
    );
  }
}








